        #region Execute Script
        public static bool Execute(ref string userError, ref string systemError, List<string> lst, bool ignoreException = true)
        {
            if ((string.Concat(lst)).IsNullOrWhiteSpace())//không có query
                return true;
            #region NET 4.0
            //string query = string.Join(" "
            //                            , lst.Where(x => !string.IsNullOrWhiteSpace(x)).Select(x => string.Format("EXECUTE IMMEDIATE '{0}';", x.Replace("'", "''")))); 
            #endregion
            //Đã cập nhật, chưa upd lại cho NET 4.0
            string query = string.Join(Environment.NewLine
                                    , (from x in lst
                                       where !x.IsNullOrWhiteSpace()
                                       select string.Format("BEGIN EXECUTE IMMEDIATE '{0}'; {1} END;"
                                                            , x.Replace("'", "''")
                                                            , ignoreException ? @"EXCEPTION WHEN others THEN null;"
                                                                             : string.Empty)).ToArray());


            var sql = @"BEGIN " + query + "END;";

            return _acc.Execute_Data(ref userError, ref systemError, sql);

        }

        public static bool ExecuteMulti(ref string userError, ref string systemError, List<string> lst, bool ignoreException = true)
        {
            if ((string.Concat(lst)).IsNullOrWhiteSpace())//không có query
                return true;
            #region NET 4.0
            //string query = string.Join(" "
            //                           , lst.Where(x => !string.IsNullOrWhiteSpace(x)).Select(x => string.Format("EXECUTE IMMEDIATE q'[{0}]';", x))); 
            #endregion
            //Đã cập nhật, chưa upd lại cho 4.0
            string query = string.Join(Environment.NewLine
                                    , (from x in lst
                                       where !x.IsNullOrWhiteSpace()
                                       select string.Format("BEGIN EXECUTE IMMEDIATE q'[{0}]'; {1} END;"
                                                            , x
                                                            , ignoreException ? @"EXCEPTION WHEN others THEN null;"
                                                                              : string.Empty)).ToArray());
            var sql = @"BEGIN " + query + "END;";

            return _acc.Execute_Data(ref userError, ref systemError, sql);

        }

        public static bool Execute_Insert(ref string userError, ref string systemError, string queryInsert, bool ignoreException = true)
        {
            if (queryInsert.IsNullOrWhiteSpace())//không có query
                return true;
            #region NET 4.0
            //string query = string.Join(" "
            //                            , queryInsert.Split(';').Select(x => string.Format("EXECUTE IMMEDIATE q'[{0}]';", x))); 
            #endregion
            string query = string.Join(" "
                                    , (from x in queryInsert.Split(';')
                                       where !string.IsNullOrWhiteSpace(x)
                                       select string.Format("BEGIN EXECUTE IMMEDIATE q'[{0}]'; {1} END;"
                                                            , x
                                                            , ignoreException ? @"EXCEPTION WHEN others THEN null;"
                                                                             : string.Empty)).ToArray());
            var sql = @"BEGIN " + query + "END;";

            return _acc.Execute_Data(ref userError, ref systemError, sql);
        }

