        #region Check exist object database
        static bool Exist(string owner, string name, string type, string schema = null)
        {
            var sql = string.Format(@"SELECT * FROM all_objects
                                    WHERE UPPER(owner) = '{0}' 
                                        AND UPPER(object_name) = '{1}'
                                        AND UPPER(object_type) = '{2}'"
                        , string.IsNullOrWhiteSpace(schema)
                                ? owner.ToUpper()
                                : owner.ToUpper() + schema
                        , name.ToUpper()
                        , type.ToUpper());
            using (DataTable dt = _acc.Get_Data(sql))
            {
                return (dt != null && dt.Rows.Count > 0);
            }
        }
