        #region Format chuỗi kiểu dữ liệu cho Oracle SQL
        static string FormatTypeStr(string typeName, string length, string precision, string scale)
        {
            int num;
            string result = "";
            switch (typeName)
            {
                case "NUMBER":
                    if (!precision.IsNullOrWhiteSpace())
                    {
                        result = string.Format("NUMBER ({0}{1})"
                                            , precision
                                            , !scale.IsNullOrWhiteSpace()
                                                ? "," + scale
                                                : "");
                        break;
                    }
                    else
                        result = "NUMBER";
                    break;
                case "VARCHAR2":
                    int.TryParse(length, out num);
                    result = string.Format("VARCHAR2({0})", num == 0 ? "4000" : num.ToString());
                    break;
                case "NVARCHAR2":
                    int.TryParse(length, out num);
                    if (num <= 2000)
                    {
                        result = string.Format("NVARCHAR2({0})", num == 0 ? "2000" : num.ToString());
                        break;
                    }
                    else
                    {
                        result = string.Format("NVARCHAR2({0})", "2000");
                        break;
                    }
                case "DATE":
                    result = "DATE";
                    break;
				case "CLOB":
					result = "CLOB";
					break;
				default:
                    result = "VARCHAR2(4000)";
                    break;
            }
            return result;
        }
        #endregion

        #region Create table with one method
        static bool CreatingTable(string sql, string tbName, string schema = null)
        {


			if (!Exist(_user, tbName, "TABLE", schema))
            {
                #region Tạo bảng
                //sql = sql.Replace(cls_BenhAnNgoaiTru.tb_TenBang.ToUpper(), cls_BenhAnNgoaiTru.tb_TenBang.ToUpper() + "2");//nguy hiểm
                if (!Execute(ref _userError, ref _systemError, new List<string> { sql }))
                {
                    TA_MessageBox.MessageBox.Show(tbName + " " + _systemError, TA_MessageBox.MessageIcon.Error);
                    return false;
                }
                #endregion
            }
            else
            {
                Diff(sql, tbName, schema);
                return true;
            }
            return true;
        }
        #endregion

    }

    public static class StringExtensions
    {
        public static bool IsNullOrWhiteSpace(this string value)
        {
            if (value == null) return true;
            return string.IsNullOrEmpty(value.Trim());
        }
    }

